        <div id="Landing" className="fade-in">
          <div id='inner'>
            <h1>Recoilize<img src={Logo} alt="Recoilize logo"/></h1>
            <p id='italic'>Development Tool for Recoil</p>
          </div>
        </div>
    )
}
